nameOverride: ""
fullnameOverride: ""

image:
  name: docker.subshell.com/sophora/sophora-webclient
  # Overrides the image tag whose default is the chart appVersion.
  tag: ""
  pullPolicy: IfNotPresent

# - (object) k8s Pod host aliases which will be used to generate the /etc/hosts file.
hostAliases:

imagePullSecrets: []

javaOptions: "-XX:InitialRAMPercentage=50.0 -XX:MaxRAMPercentage=80.0 -XX:+ExitOnOutOfMemoryError -XX:+PerfDisableSharedMem"

podAnnotations: {}

sophora:
  authentication:
    secret:
      name: ""
      passwordKey: "password"
      usernameKey: "username"

startupProbe:
  failureThreshold: 15
  initialDelaySeconds: 10
  timeoutSeconds: 5
  periodSeconds: 5

readinessProbe:
  failureThreshold: 5
  initialDelaySeconds: 5
  timeoutSeconds: 5
  periodSeconds: 5

livenessProbe:
  failureThreshold: 3
  initialDelaySeconds: 15
  timeoutSeconds: 10
  periodSeconds: 60

ingress:
  # For Kubernetes >= 1.18 you should specify the ingress-controller via the field ingressClassName
  # See https://kubernetes.io/blog/2020/04/02/improvements-to-the-ingress-api-in-kubernetes-1.18/#specifying-the-class-of-an-ingress
  # ingressClassName: nginx
  tls:
  hosts:
  annotations: {}

service:
  type: ClusterIP
  port: 8080

extraDeploy: []

extraEnv:

serviceMonitor:
  enabled: false
  interval: 10s

resources:
  requests:
    cpu: 200m
    memory: 4Gi
  limits:
    memory: 4Gi

webclient:
  binaryFilesBase64:
    logo.png: ""

  configuration:
